import logo from './logo.svg';
import './App.css';

function App() {
  const [jsonData, setJsonData] = useState([]);
  const [filteredData, setFilteredData] = useState([]);
  const targetTimestamp = "2023-12-31T19:12:00.000+00:00"; // Change this to your target timestamp

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('/data.json'); // Adjust the path as needed
        const data = await response.json();
        setJsonData(data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []); // Empty dependency array ensures effect runs only once

  useEffect(() => {
    const filtered = jsonData.filter(item => item.time === targetTimestamp);
    setFilteredData(filtered);
  }, [jsonData, targetTimestamp]);

  return (
    <div>
      <h1>JSON Data for Timestamp: {targetTimestamp}</h1>
      <ul>
        {filteredData.map(item => (
          <li key={item.id}>
            ID: {item.id}, Time: {item.time}, Value: {item.value.toString()}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
